CREATE TABLE `yjy_doctor` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `code` varchar(40) DEFAULT NULL,  `name` varchar(40) DEFAULT NULL,  `ranks` varchar(40) DEFAULT NULL,  `sex` int(1) DEFAULT NULL,  `creationTime` datetime DEFAULT NULL,  `modifiedTime` datetime DEFAULT NULL,  `ts` datetime DEFAULT NULL,  `dr` int(1) DEFAULT NULL,  PRIMARY KEY (`id`)) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;
